import React from "react";
import "./Header.css";

const Header = ({ setActiveMode }) => {
  return (
    <div className="header">
      <button onClick={() => setActiveMode("video")}>Video</button>
      <button onClick={() => setActiveMode("text")}>Text</button>
      <button onClick={() => setActiveMode("image")}>Image</button>
      <button onClick={() => setActiveMode("audio")}>Audio/Voice</button>
    </div>
  );
};

export default Header;
